import { Container } from 'react-bootstrap'
import {BrowserRouter ,Routes, Route} from 'react-router-dom'

import Header from "./components/Header";
import Footer from "./components/Footer";
import HomePage from "./pages/HomePage"

function App() {
  return (
    <BrowserRouter>
    <div>
    <Header />
    <main className='py-3'>
      <Container>
      <HomePage/>
      </Container>
    </main>
    <Footer/>

    </div>
    </BrowserRouter>
  );
}

export default App;
